  false,\n\t\"url\": null,\n\t\"notes\": \"The 2015 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Mastern                                 Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). These boundary
  files aren                                 specifically designed for small-scale
  thematic mapping. When possible, generalization is performed with the intent to
  maintain then                                 hierarchical relationships among geographies
  and to maintain the alignment of geographies within a file set for a given year.n
  \                                Geographic areas may not align with the same areas
  from another year. Some geographies are available as nation-based files while othersn
  \                                are available only as state-based files.nn                                 SLDU
  stands for State Legislative District Upper Chamber.  State Legislative Districts
  (SLDs) are the areas from which members aren                                 elected
  to state legislatures. The SLDs embody the upper (senate) and lower (house) chambers
  of the state legislature. Nebraska has an                                 unicameral
  legislature and the District of Columbia has a single council, both of which the
  Census Bureau treats as upper-chambern                                 legislative
  areas for the purpose of data presentation; there are no data by SLDL for either
  Nebraska or the District of Columbia. An                                 unique
  three-character census code, identified by state participants, is assigned to each
  SLD within a state. In Connecticut, Illinois,n                                 Louisiana,
  Maine, Maryland, Massachusetts, Michigan, Ohio, and Puerto Rico, the Redistricting
  Data Program (RDP) participant did notn                                 define the
  SLDs to cover all of the state or state equivalent area. In these areas with no
  SLDs defined, the code \"ZZZ\" has beenn                                 assigned,
  which is treated as a single SLD for purposes of data presentation. nn                                 The
  boundaries of the 2014 state legislative districts were provided by state-level
  participants through the RDP and reflect then                                 districts
  used to elect members in or prior to the November 2014 election.\",\n\t\"license_title\":
